//david-dm.org/bbc/psammead.svg?path=packages/components/psammead-bulletin)](https://david-dm.org/bbc/psammead?path=packages/components/psammead-bulletin) [![peerDependencies Status](https://david-dm.org/bbc/psammead/peer-status.svg?path=packages/components/psammead-bulletin)](https://david-dm.org/bbc/psammead?path=packages/components/psammead-bulletin&type=peer) [![Storybook](https://raw.githubusercontent.com/storybooks/brand/master/badge/badge-storybook.svg?sanitize=true)](https://bbc.github.io/psammead/?path=/story/bulletin--containing-image) [![GitHub license](https://img.shields.io/badge/license-Apache%202.0-blue.svg)](https://github.com/bbc/psammead/blob/latest/LICENSE) [![npm version](https://img.shields.io/npm/v/@bbc/psammead-bulletin.svg)](https://www.npmjs.com/package/@bbc/psammead-bulletin) [![PRs Welcome](https://img.shields.io/badge/PRs-welcome-brightgreen.svg)](https://github.com/bbc/psammead/blob/latest/CONTRIBUTING.md)\n\n## Description\n\nThe `Bulletin` component can be used to render `Radio` or `TVBulletin` by passing in the `type`.\n\n## Installation\n\n```jsx\nnpm install @bbc/psammead-bulletin --save\n```\n\n## Props\n\n### Bulletin\n\n\x3c!-- prettier-ignore --\x3e\n| Argument  | Type | Required | Default | Example |\n| --------- | ---- | -------- | ------- | ------- |\n| `script` | object | yes | N/A | `{ canon: { groupA: { fontSize: '28', lineHeight: '32',}, groupB: { fontSize: '32', lineHeight: '36', }, groupD: { fontSize: '44', lineHeight: '48', }, }, trafalgar: { groupA: { fontSize: '20', lineHeight: '24', }, groupB: { fontSize: '24', lineHeight: '28', }, groupD: { fontSize: '32', lineHeight: '36', }, }, }` |\n| `service` | string | yes | N/A | `'pidgin'` |\n| `dir` | string | no | `'ltr'` | `One of ['rtl', 'ltr']` |\n| `image` | node | no | `null` | `<Image src={src} alt={alt} />` |\n| `type` | string | yes | N/A | `One of ['audio', 'video']` |\n| `ctaText` | string | yes | N/A | `Watch` |\n| `ctaLink` | string | yes | N/A | `'http://link.to.resource'` |\n| `summary` | string | no | `null` | `'Bulletin summary'` |\n| `headlineText` | string | yes | N/A  | `'Bulletin headline'` |\n| `isLive` | boolean | no | `false` | `true` |\n| `liveText` | string | no | `'Live'` | `'Localised Live'` |\n| `offScreenText` | string | yes | N/A | `'Watch Live'` |\n| `lang` | string | no | `null` | `'en-GB'` |\n\n## Usage\n\n```jsx\nimport Bulletin from '@bbc/psammead-bulletin';\nimport { Image } from '@bbc/psammead-image';\nimport { latin } from '@bbc/gel-foundations/scripts';\n\nconst WrappingComponent = () => {\n  const image = <Image src=\"/image.png\" altText=\"alt text\" />;\n\n  return (\n    <Bulletin\n      script={latin}\n      service=\"news\"\n      image={image}\n      type=\"video\"\n      ctaLink=\"/cta\"\n      ctaText=\"Watch\"\n      summary=\"This is the summary\"\n      headlineText=\"This is the headline\"\n      isLive\n      offScreenText=\"Watch LIVE\"\n    />\n  );\n};\n```\n\n### When to use this component\n\nThe `Bulletin` component is designed to be used to link to a page on which the user can play the radio or TV content.\n\n\x3c!-- ### When not to use this component --\x3e\n\n### Accessibility notes\n\nThis component uses full semantic markup for the `BulletinHeading`, `BulletinSummary`, and `BulletinHeadingLink`, using `h3`, `p` and `a` respectively. Other accessibility factors such as image alt text and time elements are passed in as props and aren't explicitly set in this component.\n\nThe link is nested inside the `h3` for better support with VoiceOver Mac and Safari. We use the `faux block link` pattern which makes the entire block clickable, whilst also enabling links nested within in that block to also be clickable.\n\nThe Call To Action is hidden from screen-readers to prevent the repetition from the title. The hidden text passed in as a prop is used before the headline to indicate to screen-reader users what type of content it is.\n\n## Contributing\n\nPsammead is completely open source. We are grateful for any contributions, whether they be new components, bug fixes or general improvements. Please see our primary contributing guide which can be found at [the root of the Psammead repository](https://github.com/bbc/psammead/blob/latest/CONTRIBUTING.md).\n\n### [Code of Conduct](https://github.com/bbc/psammead/blob/latest/CODE_OF_CONDUCT.md)\n\nWe welcome feedback and help on this work. By participating in this project, you agree to abide by the [code of conduct](https://github.com/bbc/psammead/blob/latest/CODE_OF_CONDUCT.md). Please take a moment to read it.\n\n### License\n\nPsammead is [Apache 2.0 licensed](https://github.com/bbc/psammead/blob/latest/LICENSE).\n"},444:function(module,__webpack_exports__,__webpack_require__){"use strict";var _emotion_styled_base__WEBPACK_IMPORTED_MODULE_0__=__webpack_require__(3),react__WEBPACK_IMPORTED_MODULE_1__=__webpack_require__(0),react__WEBPACK_IMPORTED_MODULE_1___default=__webpack_require__.n(react__WEBPACK_IMPORTED_MODULE_1__),prop_types__WEBPACK_IMPORTED_MODULE_2__=__webpack_require__(1),_bbc_psammead_styles_font_styles__WEBPACK_IMPORTED_MODULE_3__=__webpack_require__(10),_bbc_gel_foundations_spacings__WEBPACK_IMPORTED_MODULE_4__=__webpack_require__(2),_bbc_psammead_styles_colours__WEBPACK_IMPORTED_MODULE_5__=__webpack_require__(5),_bbc_gel_foundations_typography__WEBPACK_IMPORTED_MODULE_6__=__webpack_require__(8),Container=Object(_emotion_styled_base__WEBPACK_IMPORTED_MODULE_0__.a)("div",{target:"e1c9i7u10"})("align-items:center;display:flex;",(function(_ref){return _ref.avatar&&"\n      margin-right: -".concat(_bbc_gel_foundations_spacings__WEBPACK_IMPORTED_MODULE_4__.e,";\n      margin-left: -").concat(_bbc_gel_foundations_spacings__WEBPACK_IMPORTED_MODULE_4__.e,";\n    ")}),""),Avatar=Object(_emotion_styled_base__WEBPACK_IMPORTED_MODULE_0__.a)("img",{target:"e1c9i7u11"})("border-radius:50%;height:","4rem",";margin-right:",_bbc_gel_foundations_spacings__WEBPACK_IMPORTED_MODULE_4__.e,";margin-lef